        <p>JavaScript</p>
        <span className="content-boxs"></span>
        <span className="content-boxs"></span>
        <span className="content-boxs"></span>
        <br />
        <span className="content-boxs"></span>
        <span className="content-boxs"></span>
        <span className="content-boxs"></span>
      </SectionDiv>
    </>
  );
};
